import React from "react"
import estyle from "./Experience.module.scss"
import Firstbg from "../interface/firstbg/Firstbg"
import Secondbg from "../interface/secondbg/Secondbg"

const Experience = () => {

    let firstbgprops = 
    {
        delay1:0,
        delay2:2,
        duration1: .3,
        duration2: .5,
        color:'teal'
    }

    let secondbg =
    {
        delay1:1.9,
        duration1:.5,
        duration2:.7,
        color:'teal'
    }

    return (
        <div>
            <div className={`${estyle.txt1} ${estyle.space}`}>main bg</div>
            <div className={estyle.container}>
                <div className={estyle.secondlayer}>
                    <Firstbg props={firstbgprops}/>
                </div>
                <div className={estyle.thirdlayer}>
                    <Secondbg props={secondbgprops}/>
                </div>
            </div>
        </div>
    );
};

export default Experience;
